import React from "react";
import Post from "./post/Post";
import classes from "./Posts.module.css";

function Posts(props) {
  let postData = [
    {
      names: "Danny",
      id: 0,
      message: "Hi, bird, how are you?!",
      likeCount: "15",
    },
    { names: "Danny", id: 1, message: "Lets fire", likeCount: "10" },
    { names: "Danny", id: 2, message: "U smell like sheep", likeCount: "7" },
    { names: "Danny", id: 3, message: "Hi bro", likeCount: "2" },
  ];

  let postsElements = postData.map((p) => (
    <Post name={p.names} likeCount={p.likeCount} message={p.message} />
  ));

  return (
    <div className={classes.posts}>
      <div className={classes.area}>
        <input type="text" />
        <br />
        <button>Add</button>
        <button>Clear</button>
      </div>
      <div className={classes.postsItem}>
        <h2>My posts</h2>
        {postsElements}
      </div>
    </div>
  );
}
export default Posts;
